    def trade_live(self):
        cash = float(self.lineEdit_35.text())
        algo_name = self.listbox.currentItem().text()
        algorithm = self.zaur.algos[algo_name]
        timeframe = '3M'
        interval = '30m'
        since = self.zaur.get_since(timeframe)
        df = self.zaur.get_data2(self.zaur.current_exchange.id, list(algorithm.params.index), interval, since)
        print(since)
        print(timeframe)
        print(algorithm.params)
        print(type(algorithm.params))
        print(algo_name)
        print(df)

        thread = threading.Thread(target=self.zaur.trade_live, args=(df, algorithm, cash))

        thread.start()

        dialog = QtWidgets.QMessageBox()
        dialog.setText('Live trading started.')
        dialog.setStyleSheet("background-color: rgb(12, 28, 48);\n"
                             "color: rgb(255, 255, 255);\n"
                             "font: 75 11pt \"FreeMono Bold\";")
        dialog.exec_()


    def stop_algo(self):
        self.zaur.algo_running = False
        dialog = QtWidgets.QMessageBox()
        dialog.setText('Algorithm stopped.')
        dialog.setStyleSheet("background-color: rgb(12, 28, 48);\n"
                             "color: rgb(255, 255, 255);\n"
                             "font: 75 11pt \"FreeMono Bold\";")
        dialog.exec_()

    def save_algo(self, algo_name):
        self.listbox.addItem(algo_name)

    def delete_algo(self, algo_name):
        self.listbox.clear()
        self.listbox.addItems(self.zaur.algos.keys())


